CREATE TABLE IF NOT EXISTS "sucursales" (
	"id"	INTEGER,
	"nombre"	TEXT,
	"direccion"	TEXT
);
CREATE TABLE IF NOT EXISTS "vendedores" (
	"id"	INTEGER,
	"nombre"	TEXT,
	"sucursal"	INTEGER,
	"fecha_ingreso"	TEXT,
	"planta"	INTEGER
);
CREATE TABLE IF NOT EXISTS "productos" (
	"id"	INT,
	"nombre"	TEXT,
	"precio_actual"	REAL,
	"stock"	INT
);
CREATE TABLE IF NOT EXISTS "ventas_productos" (
	"id"	INT,
	"id_producto"	INT,
	"id_venta"	INT,
	"cantidad"	INT
);
CREATE TABLE IF NOT EXISTS "ventas" (
	"id"	INTEGER,
	"id_vendedor"	INTEGER,
	"total"	REAL,
	"fecha"	TEXT
);
